import { StyleSheet } from "react-native";
export const addMatiereStyle = StyleSheet.create({
    content: {
        padding: 15,
        paddingTop: 300,
        justifyContent: 'center',
        alignItems: 'center'
    },

    button: {
        margin: 15,
        marginLeft: 0,
        marginRight: 0

    }

})
